import { createApi, fetchBaseQuery } from "@reduxjs/toolkit/query/react";

export const githubApi = createApi({
  baseQuery: fetchBaseQuery({ baseUrl: "https://api.github.com/" }),
  endpoints: (builder) => ({
    searchRepos: builder.query<any, string>({
      query: (query) => `search/repositories?q=${query}`,
    }),
    // getRepoCollab: builder.query<any, { owner: string|undefined; repo: string|undefined }>({
    //   query: ({ owner, repo, token }) => `repos/${owner}/${repo}/collaborators`,
    // }),

    useGetRepoCollabQuery
  }),
});

export const { useSearchReposQuery, useGetRepoCollabQuery } = githubApi;
